import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Form from './Form'; // Import the Form component

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/form" element={<Form />} /> 
      </Routes>
    </BrowserRouter>
  );
}
